&quot;Dreams&quot; is a song by Van Halen released in 1986 from the album 5150. It was the second single from that album, and it reached #22 in the Billboard Hot 100 chart that year. &quot;Dreams&quot; also appeared on the soundtrack to Mighty Morphin Power Rangers: The Movie almost 10 years later, which introduced Van Halen to a new generation of potential fans. &quot;Dreams&quot; was written during the Hagar era of the band and has become a staple at concerts. It was performed during most tours featuring Sammy Hagar, including the most recent Hagar reunion tour.

There were technically three music videos made for the song. The most well known version was shot in 1986 and featured the Blue Angels performing a variety of aerial stunts. This video is that version.



